$(".download").click(function(){  
	//alert('hi');
    $.post("/pass").done(function(data, jqXHR) {
       //alert(data);
       for(var i=data.length-1;i<data.length;i++){
        var doc = new jsPDF('p', 'pt');
        var myhub = 'data:image/jpeg;base64,';
        var thub = 'data:image/png;base64,';
        doc.addImage(myhub,'jpg',0,0,600,400);
        doc.addImage(thub,'jpg',438,375,150,25);
        doc.setFontSize(10);
        doc.text(100,54,data[i].id1);
        doc.text(260,52,data[i].vfdate);
        doc.text(340,52,'Time In :'+data[i].vtimein);
        doc.setFontSize(10);
        doc.text(150,73,data[i].vname);
        doc.text(150,91,data[i].number);
        doc.text(150,108,data[i].place);
        doc.text(150,125,data[i].phone);
        doc.text(150,142,data[i].vehicle);
        doc.text(150,158,data[i].purpose);
        doc.text(150,176,data[i].search);
        doc.text(150,194,data[i].college);
        doc.text(150,211,data[i].material);
        doc.autoPrint();
        doc.save(+data[i].id1+'.pdf');
        } 
    }); 
});
